import React from "react";
import Link from "next/Link";
import "../src/styles/style.module.css";

function Page() {
  return (
    <>
      <h1>Index Page #w)ha!</h1>

      <Link href="/notes">
        <a>Notes</a>
      </Link>
    </>
  );
}

export default Page;
